import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './AuthContext';

// Import existing components that we know exist
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Dashboard from './pages/Dashboard/Dashboard';
import NotFound from './pages/NotFound/NotFound';

// Import your styles
import './styles/globals.css';

// Simple temporary components for missing pages
const Home = () => (
  <div className="min-h-screen py-20 bg-gray-50">
    <div className="container px-4 mx-auto text-center">
      <h1 className="mb-6 text-4xl font-bold text-blue-600">Welcome to Zuree Telecom</h1>
      <p className="mb-8 text-xl text-gray-600">Your trusted telecom partner</p>
      <div className="px-4 py-3 mb-4 text-green-700 bg-green-100 border border-green-400 rounded">
        ✅ React Router is working! This is the Home page.
      </div>
      <div className="p-4 text-white bg-blue-500 rounded">
        🎨 Tailwind CSS is working! This box should be blue.
      </div>
    </div>
  </div>
);

const About = () => (
  <div className="min-h-screen py-20 bg-gray-50">
    <div className="container px-4 mx-auto">
      <h1 className="mb-8 text-4xl font-bold">About Us</h1>
      <p className="text-lg">About page content coming soon...</p>
    </div>
  </div>
);

const Services = () => (
  <div className="min-h-screen py-20 bg-gray-50">
    <div className="container px-4 mx-auto">
      <h1 className="mb-8 text-4xl font-bold">Our Services</h1>
      <p className="text-lg">Services page content coming soon...</p>
    </div>
  </div>
);

// Simple Navigation Component
const SimpleNav = () => (
  <nav className="p-4 text-white bg-blue-600">
    <div className="container flex items-center justify-between mx-auto">
      <h1 className="text-2xl font-bold">Zuree Telecom</h1>
      <div className="space-x-4">
        <a href="/" className="hover:text-blue-200">Home</a>
        <a href="/about" className="hover:text-blue-200">About</a>
        <a href="/services" className="hover:text-blue-200">Services</a>
        <a href="/login" className="hover:text-blue-200">Login</a>
      </div>
    </div>
  </nav>
);

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <SimpleNav />
          <Routes>
            {/* Main routes */}
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/services/:category" element={<Services />} />
            <Route path="/careers" element={<div className="py-20"><div className="container px-4 mx-auto"><h1 className="text-4xl font-bold">Careers</h1><p>Coming soon...</p></div></div>} />
            <Route path="/blog" element={<div className="py-20"><div className="container px-4 mx-auto"><h1 className="text-4xl font-bold">Blog</h1><p>Coming soon...</p></div></div>} />
            <Route path="/contact" element={<div className="py-20"><div className="container px-4 mx-auto"><h1 className="text-4xl font-bold">Contact Us</h1><p>Coming soon...</p></div></div>} />
            <Route path="/dashboard" element={<Dashboard />} />
            
            {/* Auth routes */}
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            
            {/* 404 Route */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
